import { AdminPage } from './pages/admin/AdminPage/AdminPage';
import { PostPage } from './pages/PostPage/PostPage';
import { Login } from './pages/Login/Login';
import { PostDetailsAdmin } from './components/admin/PostDetailsAdmin/PostDetailsAdmin';

export const routes = [
  {
    path: '/',
    exact: true,
    component: PostPage 
  },
  {
    path: '/home',
    exact: true,
    component: PostPage
  },
  {
    path: '/admin',
    exact: true,
    component: AdminPage
  },
  {
    path: '/admin/post',
    exact: true,
    component: PostDetailsAdmin,
  },
  {
    path: '/admin/post/:postId',
    exact: true,
    component: PostDetailsAdmin,
  },
  {
    path: '/post',
    exact: true,
    component: PostPage
  },
  {
    path: '/post/:postId',
    exact: true,
    component: PostPage
  },
  {
    path: '/connexion',
    exact: true,
    component: Login
  },
];
